import React, { Component }  from 'react';

const API_CAST = "http://api.tvmaze.com/shows/"

const array_json = (path) => {
    fetch(path.concat("/cast"))
    .then(res => res.json())
    .then(json => {
      return (json)
    })
}

const create_path_cast = (id) => {
	window.alert(id)
	return (API_CAST + id)
}

class App extends Component {
  render() {
    return (
      <Router>
        <div className="App">
          <Switch>
            <Route path="/info">
              <HEADER />
              <INFO />
              <FOOTER />
            </Route>
            <Route path="/">
              <HEADER />
              <HOME />
              <FOOTER />
            </Route>
          </Switch>
        </div>
      </Router>
    );
  }
}

export default App;
